import React from "react";
import Logo from "../../assets/logo.svg";

function index() {
  return (
    <div className="background lg:w-full lg:h-screen ">
      <div className="deep w-full h-full">
        <div className="lg:px-10">
          <Logo className="w-12 h-12" />
        </div>
      </div>
    </div>
  );
}

export default index;
